@Lorde has established her own way of being a pop star: playful, passionate, and wary of the rituals of fame. 

For Vogue’s October issue, she opens up about her blissed-out comeback album, Solar Power—a celebration of the natural word, a meditation on the hazards of a plugged-in existence, and an update on her life since our last glimpse of it.

Tap the link in our bio to read the full profile. photographed by @TheodeGueltzl, styled by #CamillaNickerson, written by Rob Haskell, creative direction by @juancp, Vogue, October 2021.
